                                                  EndTime, LocationID,
                                                  DocumentID, TerminalID,
                                                  LocationCode, LocationName,
                                                  ZNo )
                    SELECT  P.Receipt, P.SDate, LEFT(E.EmployeeName,15), B.BankName,
                            P.Descrip, P.RefNo, SUM(P.Amount), @LogedUserId,
