                            INNER JOIN dbo.Bank b ON p.BankId = b.BankID
                            INNER JOIN dbo.Employee E ON P.CashierID = E.EmployeeID
                            INNER JOIN dbo.Location l ON l.LocationID = p.LocationID
                    WHERE   p.Status = 1
