                            t.ReOrderLevel ,
                            t.Stock,
                            @LogedUserId ,
                            @UserName  ,
                            @LocationID ,
                            L.LocationCode ,
                            L.LocationName,
                            s.SupplierCode AS supCode,
                            s.SupplierName
                    FROM    dbo.InvProductStockMaster t
