-- TOTOAL NET PURCHASE

        UPDATE  dbo.InvTmpReportDetail
        SET     Qty03 = Qty01 - Qty02, Value03 = Value01 - Value02


-- STOCK - stores - qty 4
        DECLARE @HOLOCATIONID INT
        SET @HOLOCATIONID = ( SELECT    LocationID
