            ExecuteSqlQuery(@"
Create PROCEDURE [dbo].[spStockMovement]

--exec spStockAging 1,1,'2014-01-01','2014-01-01','2014-01-30',1,'110100450015','110100450015',1,1,'Admin'
    @CompanyId INT ,
