        CREATE TABLE #tempCurrentStock
            (
              [LocationID] [bigint] NOT NULL ,
              [ProductID] [bigint] NOT NULL ,
              [BatchNo] [nvarchar](25) NULL ,
              [Qty] [decimal](18, 0) NOT NULL
            )
	
	
	
        INSERT  INTO #tempProduct
                ( ProductID ,
                  ProductCode ,
                  ProductName ,
                  CostPrice ,
                  SellingPrice
                )
                SELECT  InvProductMasterID ,
                        ProductCode ,
                        ProductName ,
