                FROM    InvProductMaster
                WHERE   ProductCode BETWEEN @FromCode AND @ToCode

        DELETE  FROM InvTmpProductStockDetails
        WHERE   UserId = @UserId
	
        IF ( @TypeId = 6 ) 
            BEGIN
	
	
                INSERT  INTO InvTmpProductStockDetails
                        ( ProductCode ,
                          ProductName ,
                          CostPrice ,
                          SellingPrice ,
                          StockQty ,
                          GrossProfit ,
                          GroupOfCompanyID ,
                          CompanyID ,
                          LocationID ,
                          GivenDate ,
                          TransactionDate ,
                          TransactionNo ,
                          TransactionType ,
                          ProductID ,
                          DepartmentID ,
                          CategoryID ,
                          SubCategoryID ,
                          SubCategory2ID ,
                          SupplierID ,
                          CustomerID,
                          IsDelete ,
                          CreatedDate ,
                          CreatedUser ,
                          ModifiedDate ,
                          ModifiedUser ,
                          UniqueID ,
                          UserID ,
                          DataTransfer,
