                          Qty1,
                          Qty2,
                          Qty3,
                          Qty4,
                          Qty5,
                          Qty6,
                          Qty7,
                          Qty8,
                          Qty9,
                          Qty10
                        )
                        SELECT  tp.ProductCode ,
                                tp.ProductName ,
