                                0 as Qty10
                        FROM    #tempProduct tp
                        INNER JOIN InvProductMaster pm ON tp.ProductID = pm.InvProductMasterID
                        WHERE   tp.ProductID NOT IN (
                                SELECT  s.ProductID
