                                        WHEN '1' THEN s.Qty
                                        WHEN '2' THEN -s.Qty
                                        WHEN '3' THEN s.Qty
                                        WHEN '4' THEN -s.Qty
                                        ELSE 0
                                      END )) AS Qty ,
                                SUM(( s.SellingPrice * ( CASE s.DocumentId
                                                           WHEN '1' THEN s.Qty
                                                           WHEN '2'
                                                           THEN -s.Qty
                                                           WHEN '3' THEN s.Qty
                                                           WHEN '4'
                                                           THEN -s.Qty
                                                           ELSE 0
                                                         END ) )
                                    - ( s.CostPrice * ( CASE s.DocumentId
                                                          WHEN '1' THEN s.Qty
                                                          WHEN '2' THEN -s.Qty
                                                          WHEN '3' THEN s.Qty
                                                          WHEN '4' THEN -s.Qty
                                                          ELSE 0
                                                        END ) )) AS Gp ,
                                1 ,
                                1 ,
